import React from 'react'

function Viviendas() {

    const handleClick = ()=>{
        window.open('https://www.google.com.ar/', '_blank')
        }
  return (
    <div className='sec__one'>
        <h1> Departamentos, Townhouse y Casas</h1>
        <p>La busqueda de mayor espacio y contacto con la naturaleza caracteriza a quienes deciden por Townhouses </p>
        <img src='https://peverdemarketing.com/wp-content/uploads/2022/10/Tonwhouse-1.png'></img>
        <br></br>
        <button className='buton-categoria-inmueble' onClick={handleClick} >Ver brochure</button>
    </div>
  )
}

export default Viviendas;
